con:config.script:
import com.eviware.soapui.support.GroovyUtils

// Declaring variables and importing properties

def pp = context.expand('${#Project#Project_Property_Email}')
log.info("PP = " + pp)
//def value =10000

// import the Request property of CreateCustomerRequest Step

def createCustomerReqXml = context.expand('${CreateCustomer#Request}')

log.info("Request xml of Create Customer "  + createCustomerReqXml)

// Creating a XML holder

def gUtil = new GroovyUtils(context)
def Xmlhol = gUtil.getXmlHolder(createCustomerReqXml)

// changing value of element Email in Request
//Xmlhol.namespaces['ns1'] = "http://tempuri.org/"
Xmlhol.setNodeValue("//*:email",pp)

// set the modified XML value to the CreateCustomerRequest#Request Property
def modifiedXmlAsString = Xmlhol.getXml()
log.info("modified XML value is as "+modifiedXmlAsString)

testRunner.testCase.getTestStepByName("CreateCustomer").setPropertyValue("Request",modifiedXmlAsString)

//Get current testsuite and testcase names
def casename = context.getTestCase().name
def Suitename = context.getTestCase().getTestSuite().name 
log.info("Suite Name"+Suitename+"casename "+casename)

// Run the CreateCustomerRequest Step
// This syntax can run any step, from any test case, from any test Suite.

testRunner.testCase.testSuite.project.testSuites[Suitename].testCases[casename].testSteps["CreateCustomer"].run(testRunner,context)

// Get the response property from CreateCustomerRequest
def createCustomerResXml = context.expand('${CreateCustomer#Response}')
log.info("createCustomerResXml => "+createCustomerResXml)

// create an xml holder to get CreateCustomer result value
def Xmlhol1 = gUtil.getXmlHolder(createCustomerResXml)
//Xmlhol1.namespaces['ns1'] = "http://tempuri.org/"
def result_addCustomerWithID = Xmlhol1.getNodeValue("//*:id")
log.info(result_addCustomerWithID)
testRunner.testCase.setPropertyValue("Result of Add Customer is ",result_addCustomerWithID)

